import React from 'react';
import ReactDOM from 'react-dom/client';

export default function Card(props) {
    return (
        <div className="card">
            <div className='photo'>
                {/* <img></img> */}
            </div>
            <div className='country'>{props.item.location}</div>
            <div className='location'>{props.item.title}</div>
            <div className='date'>
                <div className='start-date'>{props.item.startDate}</div>
                <div className='end-date'>{props.item.endDate}</div>
            </div>
            <div className='content'>{props.item.description}</div>
        </div>
    )
}
